import React, {Fragment} from 'react';

function RegisterItem(props){
    console.log(props)
    return(
            <Fragment>
              {props.list.map((value, index) => (
                    <li key={index}>{value.text} {value.amount}</li>
                ))}
</Fragment>
    )
}

export default RegisterItem;

